package com.sxit.model.common;

/**
 * 用于映射Mybatis 需要的map中间对象
 * 
 * @author agu
 * 
 */
public class LongMap {
	private Long id;

	private String name;

	public LongMap() {
		super();
		// Auto-generated constructor stub
	}

	public Long getId() {
		return id;
	}

	public void setId(Long id) {
		this.id = id;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}
}
